  import React from 'react';
  import { mdx } from '@mdx-js/react';

  export const frontMatter = {
	title: 'Uniswap Documentation'
};
export const metadata = {
  "unversionedId": "v2/index",
  "id": "v2/index",
  "isDocsHomePage": false,
  "title": "Uniswap Documentation",
  "description": "Welcome! The pages that follow contain comprehensive documentation of the Uniswap V2 ecosystem. If you are new to Uniswap, you might want to check out the Protocol Overview or FAQ first.",
  "source": "@site/docs/v2/index.md",
  "slug": "/v2/index",
  "permalink": "/docs/v2/index",
  "editUrl": "https://github.com/facebook/docusaurus/edit/master/website/docs/v2/index.md",
  "version": "current"
};
  /* @jsxRuntime classic */
/* @jsx mdx */

export const toc = [{
  value: 'Getting Started',
  id: 'getting-started',
  children: []
}, {
  value: 'Developer links',
  id: 'developer-links',
  children: []
}, {
  value: 'Reference materials',
  id: 'reference-materials',
  children: [{
    value: 'Developer community',
    id: 'developer-community',
    children: []
  }]
}];
const makeShortcode = name => function MDXDefaultShortcode(props) {
      console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
      return <div {...props}/>
    };
const Link = makeShortcode("Link");
const Wizard = makeShortcode("Wizard");
const layoutProps = {
  toc
};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <p>{`Welcome! The pages that follow contain comprehensive documentation of the Uniswap V2 ecosystem. If you are new to Uniswap, you might want to check out the `}<Link to="/docs/v2/protocol-overview" mdxType="Link">{`Protocol Overview`}</Link>{` or `}<Link to="/faq" mdxType="Link">{`FAQ`}</Link>{` first.`}</p>
    <p>{`For a high-level overview of V2, see the `}<Link to='/blog/uniswap-v2' mdxType="Link">{`introductory blog post`}</Link>{`.`}</p>
    <h2 {...{
      "id": "getting-started"
    }}>{`Getting Started`}</h2>
    <Wizard mdxType="Wizard" />
    <p>{`Explore the sidebar to find more specific documentation covering other aspects of the protocol.`}</p>
    <h2 {...{
      "id": "developer-links"
    }}>{`Developer links`}</h2>
    <p>{`The Uniswap codebase is comprised of an ecosystem of open source components.`}</p>
    <ul>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://github.com/Uniswap/uniswap-v2-core"
        }}><inlineCode parentName="a">{`uniswap-v2-core`}</inlineCode></a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://github.com/Uniswap/uniswap-v2-periphery"
        }}><inlineCode parentName="a">{`uniswap-v2-periphery`}</inlineCode></a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://github.com/Uniswap/uniswap-frontend"
        }}><inlineCode parentName="a">{`uniswap-frontend`}</inlineCode></a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://github.com/Uniswap/uniswap-sdk"
        }}><inlineCode parentName="a">{`uniswap-sdk`}</inlineCode></a></li>
    </ul>
    <h2 {...{
      "id": "reference-materials"
    }}>{`Reference materials`}</h2>
    <p>{`Get to know the Uniswap SDK and smart contract API objects, methods, attributes, and responses.`}</p>
    <ul>
      <li parentName="ul">
        <Link to="/docs/v2/SDK" mdxType="Link">SDK</Link>
      </li>
      <li parentName="ul">
        <Link to="/docs/v2/API" mdxType="Link">API</Link>
      </li>
      <li parentName="ul">
        <Link to="/docs/v2/smart-contracts" mdxType="Link">Smart Contracts</Link>
      </li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "/whitepaper.pdf"
        }}>{`Whitepaper`}</a></li>
      <li parentName="ul">
        <Link to="/docs/v2/governance/governance-reference" mdxType="Link">Governance</Link>
      </li>
    </ul>
    <h3 {...{
      "id": "developer-community"
    }}>{`Developer community`}</h3>
    <p>{`Join the Uniswap developer community on `}<a parentName="p" {...{
        "href": "https://discord.gg/FCfyBSbCU5"
      }}>{`Discord`}</a>{`.`}</p>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
